    console.log(communityName)
    return (
        <React.Fragment>
            <Box title="Create a community name">
                <Form
                    title='Enter community name'
                    onSubmit={(text: any) => {
                        setcommunityName(text)
                    }}
                />

            </Box>
        </React.Fragment>
    );
}
